import React from "react";
import { Route, Routes } from "react-router-dom";
import Navbar from "../Navbar";
import Home from "../../component/Home";

const AdminPortal = () => {
  return (
    <div>
      <Navbar />
      <Routes>
        <Route to="" path />
      </Routes>
    </div>
  );
};

export default AdminPortal;
